import React, { Component } from "react";
import "./home2.css";
import Navbar from "../../components/navbar/navbar";
import Footer from "../../components/footer/footer";
import axios from "axios";
export default class Home2 extends Component {

  constructor(props) {
    super(props);

    // this.deleteProjects = this.deleteProjects.bind(this)

    this.state = { Projects: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5003/project/")
      .then((response) => {
        this.setState({ Projects: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }
  render() {

    return (
      <div>
        <Navbar />
        <div>
        {this.state.Projects &&
            this.state.Projects.map((item, index) => {

              return (
                <div id="open-content" className="open-content" key={item._id}>
          <div className="container" >
            <div className="card-column column-0">
              <div className="card card-color-0">
                <div className="border"></div>
                <img src={`http://localhost:5003/project/projects/uploads/${item.image}`} />
                <h1>{item.title}</h1>
              </div>
            </div>
          </div>

          <div id="cover" className="cover"></div>

          <div id="open-content" className="open-content">
            <a href="#" id="close-content" className="close-content">
              <span className="x-1"></span>
              <span className="x-2"></span>
            </a>
            <img id="open-content-image" src="" />
            <div className="text" id="open-content-text"></div>
          </div>
     </div>
         );
        })}
        </div>
        <Footer />
      </div>
    );
  }
}
